import React from 'react';
import './Cards.css';

import Card from './Card.jsx';

export default function Cards({cities}) {
  
    let citiesInfo=cities;
    return (
      <div className='cards'>
        {citiesInfo.cities.map(el => <Card
            max={el.max}
            min={el.min}
            name={el.name}
            img={el.img}
            id={el.id}
            cities={citiesInfo}
          /> )}
      </div>
    );
   
}
